import faker from "faker";

export const generateData = (numEntries) => {
  const data = [];
  for (let i = 0; i < numEntries; i++) {
    const entry = {
      name: faker.name.findName(),
      city: faker.address.city(),
      country: faker.address.country(),
      incomeAmount: parseFloat(faker.finance.amount(1000, 10000)),
      totalRevenue: parseFloat(faker.finance.amount(10000, 100000)),
    };
    data.push(entry);
  }
  return data;
};
